import "./Header.css";
import logo from "../../images/img/header-logo.svg";
import HeaderMenu from "./Header-menu";

function Header() {
  const array = [
    { name: "Студия", link: "/" },
    { name: "    Услуги", link: "/" },
    { name: "  Акции", link: "/" },
    { name: "Студия", link: "/" },
  ];

  return (
    <section className="header">
      <div className="header__box">
        <a href="#">
          <img src={logo} alt="" />
        </a>
        <nav className="menu">
          <ul className="menu__items"></ul>
          <li className="menu__item">
            <Link to="/" className="menu__link">
              Студия
            </Link>
            {<SubMenu />}
          </li>
          <HeaderMenu />
        </nav>
      </div>
    </section>
  );
}

export default Header;
